growth and development of its interior. Exploiting vast natural resources and a large labor pool, it is today South America's leading economic power and a regional leader. Highly unequal income distribution remains a pressing problem.",cQe='FooterControls',dQe='FooterControls;',UOd="For centuries China stood as a leading civilization, outpacing the rest of the world in the arts and sciences, but in the 19th and early 20th centuries, the country was beset by civil unrest, major famines, military defeats, and foreign occupation. After World War II, the Communists under MAO Zedong established an autocratic socialist system that, while ensuring China's sovereignty, imposed strict controls over everyday life and cost the lives of tens of millions of people. After 1978, his successor DENG Xiaoping and other leaders focused on market-oriented economic development and by 2000 output had quadrupled. For much of the population, living standards have improved dramatically and the room for personal choice has expanded, yet political controls remain tight.",Uve='For input string: "',Dee='For record:',vee='Form was unable to be submitted. The most likely cause for this is an invalid value in an upload field.',eQe='FormErrorOrientation',fQe='FormErrorOrientation;',_Fe='FormHandlerCollection',aGe='FormHandlerCollection;',gQe='FormItemType',hQe='FormItemType;',iQe='FormLayoutType',jQe='FormLayoutType;',kQe='FormMethod',lQe='FormMethod;',bGe='FormPanel',eGe='FormPanel$1',cGe='FormPanel$SubmitCompleteEvent',dGe='FormPanel$SubmitEvent',hHd='FormPanel_',FPd='Founded in the 12th century, the Principality of Muscovy, was able to emerge from over 200 years of Mongol domination (13th-15th centuries) and to gradually conquer and absorb surrounding principalities. In the early 17th century, a new Romanov Dynasty continued this policy of expansion across Siberia to the Pacific. Under PETER I (ruled 1682-1725), hegemony was extended to the Baltic Sea and the country was renamed the Russian Empire. During the 19th century, more territorial acquisitions were made in Europe and Asia. Repeated devastating defeats of the Russian army in World War I led to widespread rioting in the major cities of the Russian Empire and to the overthrow in 1917 of the imperial household. The Communists under Vladimir LENIN seized power soon after and formed the USSR. The brutal rule of Iosif STALIN (1928-53) strengthened communist rule and Russian dominance of the Soviet Union at a cost of tens of millions of lives. The Soviet economy and society stagnated in the following decades until General Secretary Mikhail GORBACHEV (1985-91) introduced glasnost (openness) and perestroika (restructuring) in an attempt to modernize Communism, but his initiatives inadvertently released forces that by December 1991 splintered the USSR into Russia and 14 other independent republics. Since then, Russia has struggled in its efforts to build a democratic political system and market economy to replace the strict social, political, and economic controls of the Communist period. While some progress has been made on the economic front, recent years have seen a recentralization of power under Vladimir PUTIN and the erosion of nascent democratic institutions. A determined guerrilla conflict still plagues Russia in Chechnya and threatens to destabilize the North Caucasus region.',pPd='France',efe='Freeze',ffe='Freeze on left',gfe='Freeze on right',q_d='French Guiana',r_d='French Polynesia',s_d='French Southern Territories',ZBd='Fri',kCd='Friday',wTd='Friends Fianance Goals',nUd='Friendships',dee='From',Nde='From must be before To',$ge='Full justify selection',_Vd='Fun',DNd='Fun Activity',_je='GENERIC',Zzd='GET',Lje='GETPARAMS',nDd='GIF',fPd='GM',sAd='GMT',PYd='GOAL TYPE: ',bDd='GRAYSCALE',nqe='GREATER_OR_EQUAL',gre='GREATER_OR_EQUAL_FIELD',jqe='GREATER_THAN',cre='GREATER_THAN_FIELD',VJd='GREEN',aqe='GRID',t_d='Gabon',u_d='Gambia',sIe='GeoMap$DataMode',tIe='GeoMap$DataMode;',v_d='Georgia',ePd='Germany', 'Thailand',kQd="The Dutch began to colonize Indonesia in the early 17th century; the islands were occupied by Japan from 1942 to 1945. Indonesia declared its independence after Japan's surrender, but it required four years of intermittent negotiations, recurring hostilities, and UN mediation before the Netherlands agreed to relinquish its colony. Indonesia is the world's largest archipelagic state and home to the world's largest Muslim population. Current issues include: alleviating poverty, preventing terrorism, consolidating democracy after four decades of authoritarianism, implementing financial sector reforms, stemming corruption, and holding the military and police accountable for human rights violations. Indonesia was the nation worst hit by the December 2004 tsunami, which particularly affected Aceh province causing over 100,000 deaths and over $4 billion in damage. An additional earthquake in March 2005 created heavy destruction on the island of Nias. Reconstruction in these areas may take up to a decade. In 2005, Indonesia reached a historic peace agreement with armed separatists in Aceh, but it continues to face a low intensity separatist guerilla movement in Papua.",cPd='The Indus Valley civilization, one of the oldest in the world, dates back at least 5,000 years. Aryan tribes from the northwest infiltrated onto Indian lands about 1500 B.C.; their merger with the earlier Dravidian inhabitants created the classical Indian culture. Arab incursions starting in the 8th century and Turkish in the 12th were followed by those of European traders, beginning in the late 15th century. By the 19th century, Britain had assumed political control of virtually all Indian lands. Indian armed forces in the British army played a vital role in both World Wars. Nonviolent resistance to British colonialism led by Mohandas GANDHI and Jawaharlal NEHRU brought independence in 1947. The subcontinent was divided into the secular state of India and the smaller Muslim state of Pakistan. A third war between the two countries in 1971 resulted in East Pakistan becoming the separate nation of Bangladesh. Despite impressive gains in economic investment and output, India faces pressing problems such as the ongoing dispute with Pakistan over Kashmir, massive overpopulation, environmental degradation, extensive poverty, and ethnic and religious strife.',hAd='The URL ',uee='The following errors were found',Cee='The following fields are available for use in this',wFd='The response could not be deserialized',XPd='The site of advanced Amerindian civilizations, Mexico came under Spanish rule for three centuries before achieving independence early in the 19th century. A devaluation of the peso in late 1994 threw Mexico into economic turmoil, triggering the worst recession in over half a century. The nation continues to make an impressive recovery. Ongoing economic and social concerns include low real wages, underemployment for a large segment of the population, inequitable income distribution, and few advancement opportunities for the largely Amerindian population in the impoverished southern states. Elections held in July 2000 marked the first time since the 1910 Mexican Revolution that the opposition defeated the party in government, the Institutional Revolutionary Party (PRI). Vicente FOX of the National Action Party (PAN) was sworn in on 1 December 2000 as the first chief executive elected in free and fair elections.',Cfe='Then by',Uee='This Week',_ee='This action will discard all unsaved edited values for this list.',aFd='This application is out of date, please click the refresh button on your browser.',bFd='This application is out of date, please click the refresh button on your browser. ( ',jfe='This grid is limited to $count simultaneously expanded records.  Please collapse some expanded records and retry.',rhe='This item already contains a child item with that name.',QFd="This widget's parent does not implement HasWidgets",Cwe='Throwable',HDe='Thr
